
function init_frontpage(){$("#campusid").select2();$("#campusid").change(function(){var a=$(this).val();if(a!=0){$.ajax({type:"POST",url:"ajax.php?action=getBuildingsSelect&campusId="+a,dataType:"html",success:function(b){$("#buildingsSelect").html(b);$("#buildingid").select2()}})}});$("#getFloors").click(function(){var b=M.cfg.wwwroot;var a=$("#buildingid").val();window.location=b+"/local/buildings/admin/floors.php?buildingid="+a})};